import React from 'react'
import './Header.css';

const Header = () => {
  return (
    <nav className='nav-header'>
      <ul className='ul-header'>
          <li>Home</li>
          <li>About</li>
          <li>Services</li>
          <li>Contact Us</li>
      </ul>
    </nav>
  )
}

export default Header
